import React from 'react';
import './App.css';
import axios from 'axios';

export default class App extends Component {


  getmygithub = () => {

    axios.get('https://api.github.com/users/trickascp/repos')
    .then((res) => {
      console.log(res)
    })

  }

  render(){

    return


  }

}
